<p>Поддержание работы печени при хронической печеночной недостаточности. <strong>Farmina Vet Life Hepatic</strong> диетическое питание для собак при хронической печеночной недостаточности. Диета содержит ограниченное количество белка высокого качества, высокий уровень полиненасыщенных жирных кислот и высокий уровень легко усваиваемых углеводов.</p>
</body></html>

