                    <div class="tab-pane  "  id = "tab3">


                        <html><head><meta charset="utf-8"></head><body>
<h5>Ингредиенты:</h5>
<p>Спельта, животный жир, кукурузный глютен, гидролизат белка (рыба), рыбий жир, карбонат кальция, льняное семя, овес, пульпа сахарной свеклы, хлорид калия, рисовый крахмал, фруктоолигосахариды (ФОС), олигосахариды маннозы на основе экстракта из Saccharomyces cerevisiae, монодикальция фосфат, дрожжи пивные сухие, хлорид натрия, экстракт календулы (источник лютеина). Источник белка: кукурузный глютен, гидролизат белка (рыба). Источник высоко усваиваемого крахмала: рисовый крахмал.</p>
<p><strong>Пищевые добавки на кг:</strong> Витамин А 15000МЕ, Витамин D3 900МЕ, Витамин Е 800мг, Витамин С 150мг, Ниацин 38мг, Пантотеновая кислота 15мг, Витамин В2 7,5мг, Витамин В6 6мг, Витамин В1 4,5мг, Витамин Н 0,4мг, Фолиевая кислота 0,45мг, Витамин В12 0,06мг, Холина хлорид 2500мг, бета-каротин 1,5мг, хелат цинка аналогичный метионин гидроксилазе 1060мг, хелат марганца аналогичный метионин гидроксилазе 400мг, хелат железа гидрата глицина 185мг, хелат меди аналогичный метионин гидроксилазе 11мг, селенометионин 68мг, йодат кальция безводный 2,4мг, L-лизин 4500мг, DL-метионин 3000мг, таурин 1800мг, L-карнитин 350мг. Антиоксиданты: экстракт токоферолов натурального происхождения 10мг.</p>
<p><strong>Питательные вещества:</strong> Сырой белок 16,00%, сырой жир и масла 18,00%, сырая клетчатка 3,00%, сырая зола 5,90%, кальций 0,90%, фосфор 0,65%, натрий 0,25%, калий 0,70%, магний 0,085%, Омега-3 0,70%, Омега-6 3,30%, EPA 0,15%, DHA 0,20%. Незаменимые жирные кислоты 0,45%, Медь: 5мг/кг.</p>
<p><strong>Энергетическая ценность: </strong>EM Kcal/Kg 3826 - Mj/Kg 16,01.</p>
</body></html>
